In this tutorial we explore drawing 2D shapes with nannou. We will cover drawing basic lines, simple polygons (e.g. ellipses, rectangles, etc.), and more complex polygons (where you can create whatever shape you'd like)! To begin with, we will need a nannou project file to work with. Copy the following into new file: use nannou::prelude::*; fn main() { nannou::sketch(view).run();
} fn view(app: &App, frame: Frame) { // Prepare to draw. let draw = app.draw(); // Clear the background to purple. draw.background().color(PLUM); // Draw a blue ellipse with default size and position. draw.ellipse().color(STEELBLUE); // Write to the window frame. draw.to_frame(app, &frame).unwrap();
} You can also find this file, and other useful examples, in the examples directory of the nannou source repository.

