The line function provides a simple way to draw a line: let start_point = pt2(-30.0, -20.0);
let end_point = pt2(40.0, 40.0); draw.line() .start(start_point) .end(end_point) .weight(4.0) .color(STEELBLUE); A simple line Simply provide a starting point and an ending point, and you have your line. This is great for simpler drawings, but what if you want to draw something more complicated? A sine wave, for instance. To draw our sine wave, we will use the polyline function. To use this function, we will supply a collection (or array) of points that represent points on a sine wave. We can generate this array of points using—what else—the sin function! let points = (0..50).map(|i| { let x = (i as f32 - 25.0); //subtract 25 to center the sine wave let point = pt2(x, x.sin()) * 20.0; //scale sine wave by 20.0 (point, STEELBLUE)
});
draw.polyline() .weight(3.0) .points_colored(points); A sine wave polyline drawing As you can see, the power of polyline is the ability to draw a series of lines connecting and ordered array of points. With this, you can easily draw a variety of shapes or lines, so long as you can provide or generate the points you need to represent that shape. For example, a circle: let radius = 150.0; // store the radius of the circle we want to make
let points = (0..=360).map(|i| { // map over an array of integers from 0 to 360 to represent the degrees in a circle let radian = deg_to_rad(i as f32); // convert each degree to radians let x = radian.sin() * radius; // get the sine of the radian to find the x-co-ordinate of // this point of the circle, and multiply it by the radius let y = radian.cos() * radius; // do the same with cosine to find the y co-ordinate (pt2(x,y), STEELBLUE) // construct and return a point object with a color
});
draw.polyline() // create a PathStroke Builder object .weight(3.0) .points_colored(points); // tell our PathStroke Builder to draw lines connecting our array of points A custom circle A custom drawn circle! ...okay, perhaps this isn't too exciting, given that we already have an easy way of drawing circles with ellipse. But with a simple change to the above code we can generate an outline of a different shape. Let's try using the step_by function, which allows us to choose the interval at which we would like to step through a range or other iterator. So instead of calling (0..=360).map, we will call (0..=360).step_by(45).map: let points = (0..=360).step_by(45).map(|i| { The rest of our code will remain unchanged. Because 45 divides into 360 eight times, our code generated 8 points to represent a regular octagon. An octagon outline An octagon! Try experimenting with different values to pass into step_by and see the different shapes you can create! As a side note, you may have noticed that we did not use a color function to set the drawing's color this time. Instead, polyline requires that each point be given a color. This means that you can change the color of the polyline point-by-point. Try experimenting with it!

